import React from 'react';
import './css/About.css';
import lonelyfox from './static/nateshim.jpg';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import Typography from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';

const Navigation = (props: StyledProps) => {
  const classes = props.classes;
  return (   
    <Box m={3}>
      <Container className={classes.navBar} maxWidth={false}>
        <Avatar alt="Lonely Fox" src={lonelyfox}></Avatar>
        <Typography variant="h4" className={classes.text}>Nathanael Shim</Typography>
        <Link href="/" className={classes.text}> About </Link>
        <Link href="/projects" className={classes.text}> Projects </Link>        
        <Link href="/music" className={classes.text}>Music</Link>
      </Container>
    </Box> 
  );
}

const useStyles = createStyles({
  navBar: {
    display: 'flex',
    flexDirection: 'row',
    backgroundColor: '#F7F3F2',
    alignItems: 'center',
    padding: '4rem 0',

  },
  text: {
    fontFamily: 'Colombo',
    color: '#12130F',
  },
  backgroundContainer: {
    backgroundSize: 'cover',
    height: '100%',
    width: '100%',
    backgroundPosition: 'center',
  }
});

export default withStyles(useStyles)(Navigation);
